    def load_data(self, data):
        # On importe le fichier csv
        df = pd.read_excel(data).fillna('')
        # On remplace le nom des champs par la nomenclature Cyclade
        df.rename(columns = champs, inplace = True)
        # Remplacement des spés
        df.replace({'specialite1': SPE, 'specialite2': SPE, 'specialite3': SPE}, inplace=True)
        # Remplacement des LV
        df.replace({'LVA': LV, 'LVB': LV}, regex=True, inplace=True)
        # Remplacement des pays de naissance et nationalités par les code pays
        df.replace({'pays_naissance': pays, 'nationalite': pays}, inplace=True)
        # Codes postaux sont des entiers, les champs NaN par 0
        df.loc[df['code_postal'] != '', 'code_postal'] = df.loc[df['code_postal'] != '', 'code_postal'].astype(int)
        df['telephone'] = df[['Tél. Personnel', 'Tél. Portable']].apply(lambda x: x[x != ''].values[0] if not x[x != ''].empty else '', axis=1)
        df['adresse_1'] = df['adresse_1'] + ' ' + df['adresse_2'] + ' ' + df['adresse_3'] + ' ' + df['adresse_4']
        df['adresse_1'] = df['adresse_1'].str.strip().replace(' +', ' ')
        # On met les communes en minuscule et enlève les doubles espaces (apris arrondissement)
        df['commune_naissance'] = df['commune_naissance'].str.lower().replace(r'\s+', ' ', regex=True)
        # Si étranger
        mask = df.pays_naissance != 100
        df.loc[mask, 'commune_naissance'] = df['Ville Naiss. Etrangère']
        # Si France
        mask = df.pays_naissance == 100
        # On chappe le dico des commune en enlevant accents et Majuscules
        df.loc[mask, 'commune_naissance'] = df.replace({'commune_naissance': communes})
        df.loc[mask, 'depCOM_naissance'] = df['commune_naissance'].str[:2]
        mask = (df.pays_naissance == 100) & (df.depCOM_naissance != 97)
        df.loc[mask, 'depCOM_naissance'] = '0'+df['commune_naissance'].str[:2]
        mask = (df.pays_naissance == 100) & (df.depCOM_naissance == 97)
        df.loc[mask, 'depCOM_naissance'] = df['commune_naissance'].str[:3]
        # On crée des nouveaux champs avec les valeurs par défaut
        df['etablissement'] = '0442286W'
        df['serie'] = 'BCG'
        df['categorie'] = '520'
        df['pays'] = '100'
        # On crée les champs vides nécessaires à l'import
        champs_vides = ['categ_socio_pro', 'division_classe', 'enseignement', 'zone_geo_souhaitee', 'dnl', 'langue_section_inter', 'langue_section_euro']
        for vides in champs_vides:
            df[vides] = ''
        # On filtre les élèves qui ne sont pas sortis du LXP
        base = df.loc[df['Motif Sortie'] == '']
        return base

