    def generate(self):
        selected_rows = []
        # On enregistre le nouveau fichier
        date = datetime.now().strftime("%d%m%Y%H%M")
        year = str(int(datetime.now().strftime("%Y"))+1)
        file_name = "_2.3_"+year+"_"+date+".csv"
        if self.radio_button_2.isChecked():
            file_name = "terminales"+file_name             
        elif self.radio_button_1.isChecked():
            file_name = "premieres"+file_name
        for row in self.table_view.selectionModel().selectedRows():
            row_data = [self.table_model.data(row.sibling(row.row(), col), Qt.DisplayRole) for col in range(self.table_model.columnCount())]
            selected_rows.append(row_data)
        if selected_rows:
            dataframe = pd.DataFrame(selected_rows, columns=self.table_model._data.columns)
            directory = QFileDialog.getExistingDirectory(self, "Choix du dossier d'export")
            if directory:
                dataframe.to_csv(directory +"/"+file_name, sep=";", index=False)
            else:
                QMessageBox.warning(self, "Warning", "Pas de dossier sélectionné.")
        msg = QMessageBox()
        msg.setIcon(QMessageBox.Information)
        msg.setText("Le fichier {} a été exporté dans le dossier {}".format(file_name,directory))
        #msg.setInformativeText(self.label2.text())
        msg.setWindowTitle("Export des fichiers csv réalisé")
        msg.setStandardButtons(QMessageBox.Ok)
        msg.exec_()


    ## Parcoursup
    def login(self):
        chrome_options = Options()
        chrome_options.add_argument("--no-sandbox")
        chrome_options.add_argument("--disable-infobars")
        chrome_options.add_argument("--disable-extensions")
        chrome_options.add_argument("--disable-popup-blocking")
        chrome_options.add_argument('--headless')
        service = Service(executable_path='/usr/bin/chromedriver')
        self.driver = webdriver.Chrome(service=service, options=chrome_options)
        # use can defined additional parameters if needed : https://chromedevtools.github.io/devtools-protocol/tot/Page/#method-printToPDF
        self.driver.get("https://gestion.parcoursup.fr")
        # Enter the login and password values
        username_field = self.driver.find_element(By.XPATH, "//input[@name='g_ea_cod']")
        username_field.send_keys(self.line_edit_username.text())
        password_field = self.driver.find_element(By.XPATH, "//input[@name='g_ea_mot_pas']")
        password_field.send_keys(self.line_edit_password.text())
        # Submit the login form
        login_button = self.driver.find_element(By.XPATH, "//input[@type='submit']")
        login_button.click()

    def get_eleve_list(self):
        self.login()
        self.driver.get('https://gestion.parcoursup.fr/Gestion/gestionSpring?ACTION=1&url=notes')
        self.driver.get('https://notes.parcoursup.fr/NotesSpring/notes/bulletin/accueil')
        links = self.driver.find_elements(By.XPATH, "//div[@id='bloc-selection-eleve']//a[contains(@class,'list-group-item-action')]")
        result = [[link.text, link.get_attribute('href'), ''] for link in links]
        self.eleves = QStandardItemModel()
        self.eleves.setColumnCount(3)
        self.eleves.setHeaderData(0, Qt.Horizontal, "Nom")
        self.eleves.setHeaderData(1, Qt.Horizontal, "Url")
        self.eleves.setHeaderData(2, Qt.Horizontal, "Anonymat")
        for row, item in enumerate(result):
            for column, field in enumerate(item):
                self.eleves.setItem(row, column, QStandardItem(field))
                # Make column 2 editable
        for row in range(self.eleves.rowCount()):
            item = QStandardItem()
            item.setFlags(item.flags() | Qt.ItemIsEditable)
            self.eleves.setItem(row, 2, item)
        self.table_view2.setModel(self.eleves)
        self.table_view2.setColumnHidden(1, True)

