    def generate_fiche(self):
        selected_rows = []
        # On enregistre le nouveau fichier
        if len(self.table_view2.selectionModel().selectedRows()) == 0:
            QMessageBox.warning(self, "Warning", "Aucun élève sélectionné.")
        else:
            directory = QFileDialog.getExistingDirectory(self, "Choix du dossier d'export")
            for row_index in self.table_view2.selectionModel().selectedRows():
                if directory:
                    row_index = row_index.row()
                    nom = self.eleves.data(self.eleves.index(row_index, 0), Qt.DisplayRole)
                    url = self.eleves.data(self.eleves.index(row_index, 1), Qt.DisplayRole)
                    anonym = self.eleves.data(self.eleves.index(row_index, 2), Qt.DisplayRole)
                    selected_rows.append([nom,url,anonym])
                    for eleve in selected_rows:
                        self.driver.get(eleve[1])
                        anonym = eleve[2] if eleve[2] else eleve[0]
                        evaluations = self.get_eleve_data()
                        md = self.make_md_file(anonym, evaluations)
                        html = markdown.markdown(md, extensions=['extra'])
                        options = {
                            'page-size': 'A4',
                            'encoding': 'UTF-8',
                            "enable-local-file-access": "",
                            'margin-top': '50px',
                            'margin-right': '70px',
                            'margin-bottom': '50px',
                            'margin-left': '70px'
                        }
                        css=os.path.abspath("styles.css")
                        pdfkit.from_string(html, directory+'/'+nom+'.pdf',  options=options, css= css)
                else:
                    QMessageBox.warning(self, "Warning", "Pas de dossier sélectionné.")
            QMessageBox.information(self, "Information", "Export terminé.")



    def get_eleve_data(self):
        table = self.driver.find_element(By.ID, 'table-liste-notes-eleves')
        # Get all the rows of the table
        rows = table.find_elements(By.TAG_NAME, 'tr')
        # Loop through the rows and get the cells
        evaluations=[]
        for row in rows:
            cells = row.find_elements(By.TAG_NAME, 'td')
            if cells != []:
                evaluations.append((cells[0].text,cells[5].text),)
        return evaluations


